import React from 'react';
import ProductItem from './ProductItem';
import Title from './Title';
import womanJacketPink from '../assets/images/woman-jacket-pink.jpg';
import womanJacketGray from '../assets/images/woman-jacket-gray.jpg';

class NewArrivals extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			prodlist: [
				{name: 'Prod', avatar: womanJacketGray, price: 100}, 
				{name: 'Prod2', avatar: womanJacketPink, price: 200}, 
				{name: 'Prod3', avatar: womanJacketPink, price: 300}
			]
		}
	}
	render(){
		const {prodlist} = this.state;
		return (
			<div>
				<Title />
				<div className="row">
					{ prodlist.map((item, index) => {
						return (
							<div className="col-md-3">
		 						<ProductItem name={item.name} price={item.price} avatar={item.avatar}/>
		 					</div>
						)
					}) }	
				</div>
			</div>
		)
	}
}

export default NewArrivals;
